package colornames_test

import (
	"bytes"
	"encoding/base64"
	"fmt"
	"image"
	"image/png"

	"github.com/takumakei/go-colornames"
)

const (
	W = 160
	H = 160
	P = 3
)

func Example_allColors() {
	m := image.NewRGBA(image.Rect(0, 0, W*P, H*P))

	i := 0
	for y := 0; y < H; y++ {
		for x := 0; x < W; x++ {
			c := colornames.RGB(i)
			xp, yp := x*P, y*P
			for v := 0; v < P; v++ {
				for u := 0; u < P; u++ {
					m.Set(xp+u, yp+v, c)
				}
			}
			i++
			if i >= colornames.N {
				break
			}
		}
	}

	var b bytes.Buffer
	if err := png.Encode(&b, m); err != nil {
		panic(err)
	}
	fmt.Println("IMAGE:" + base64.StdEncoding.EncodeToString(b.Bytes()))
	// Output:
	// IMAGE:
}
